// This is a bootstrap file for the Microsfot Add-On Widget for Zipwhip
(function() {
    
    // alert("hi");
    
    function load(script) {
        //document.write('<'+'script src="'+script+'" type="text/javascript"><' + '/script>');
        var fileref = document.createElement('script');
        fileref.setAttribute("type", "text/javascript");
        fileref.setAttribute("src", script);
        document.getElementsByTagName("head")[0].appendChild(fileref);
    }
    
    function doit() {
        console.log("insede doit method");
        
        // Inject new div to contain widget or use an existing div with an ID
        $("body").append('<' + 'div id="myDivComZipwhipWidgetMsft"><' + '/div>');
        
        chilipeppr.load(
          "#myDivComZipwhipWidgetMsft",
          "https://preview.c9users.io/chilipeppr/zw-msft/auto-generated-widget.html",
          function() {
            // Callback after widget loaded into #myDivComZipwhipWidgetMsft
            // Now use require.js to get reference to instantiated widget
            cprequire(
              ["inline:com-zipwhip-widget-msft"], // the id you gave your widget
              function(myObjComZipwhipWidgetMsft) {
                // Callback that is passed reference to the newly loaded widget
                console.log("Widget / Microsoft Graph API for Zipwhip just got loaded.", myObjComZipwhipWidgetMsft);
                myObjComZipwhipWidgetMsft.init();
              }
            );
          }
        );
        
        // var dashEl = $('<div id="zw-dashboard-global-instantiation"></div>');
        // $('body').append(dashEl);
        // return;
        // var d = new Date();
        
        // Swap in Microsoft Waffle Menu to left of Zipwhip logo
        // $('#zw-menubar-wrapper .zw-menu-item-wrapper .zw-z-button button').css('background-image', 'url("https://i2dcui.appspot.com/geturl?url=http://www.telmetrics.com/skin/images/telmetrics-logo.svg")');
        // $('#zw-menubar-wrapper .zw-menu-item-wrapper .zw-z-button button')
        //     .css('background-position', 'left 0px !important')
        //     .css('background-size', 'contain')
        //     .css('background-image', 'url(data:image/png;base64,)')
        //     ;
        /*$('#zw-menubar-wrapper .zw-menu-item-wrapper .zw-z-button button').attr('style', 
            'background-position: left 0px !important;background-size: contain;background-image:url(data:image/png;base64,)'
        );*/
    }
    //alert("inside first part of body");

    console.log("Loading require.js");
    //load("http://www.chilipeppr.com/js/require.js");
    //load("//i2dcui.appspot.com/js/ssl_require.js");
    // //i2dcui.appspot.com/js/require.js
    load("//i2dcui.appspot.com/js/require.js");

    // do 3 attempts at 10ms, 100ms, 1000ms
    setTimeout(function() {
        // alert("Loading Claure Widget");
        console.log("Loading Microsoft Graph API Override. 1st try.");
        if (typeof(cprequire) === 'undefined') {
            console.log("Loading Microsoft Graph API Override. 2nd try.");
            setTimeout(function() {
                if (typeof(cprequire) === 'undefined') {
                    console.log("Loading Microsoft Graph API Override. 3rd try.");
                    setTimeout(function() {
                        cprequire(["chilipeppr_ready"], function() {
                            console.log("Seeing if Chilipeppr is globally defined...");
                            console.log(chilipeppr);
                            // do the actual load logic
                            doit();
                        });
                    }, 1000);
                } else {
                    cprequire(["chilipeppr_ready"], function() {
                        console.log("Seeing if Chilipeppr is globally defined...");
                        console.log(chilipeppr);
                        // do the actual load logic
                        doit();
                    });
                }
            }, 100);
        } else {
            cprequire(["chilipeppr_ready"], function() {
                console.log("Seeing if Chilipeppr is globally defined...");
                console.log(chilipeppr);
                // do the actual load logic
                doit();
            });
        }
    }, 10);

})();
